/**************************************************************************
* Purpose: World class - for the units to walk on
***************************************************************************/

export default class world {

    constructor(length, width) {
      this.xMin = 0;
      this.xMax = length - 1;
      this.yMin = 0;
      this.yMax = width - 1;
    }

    /**
    * Changes the world size based on provided input
    * @param  length
    * @param  width
    */           
    changeSize(length, width) {
      this.xMax = length - 1;
      this.yMax = width -  1;
    }

    getMaxX() {
        return this.xMax;
    }

    getMaxY() {
        return this.yMax;
    }

  }
